import{_ as t,a as e,b as r}from"./chunks/voxl-2-connectors.4h5HMRIY.js";import{_ as a,c as o,o as d,ab as i}from"./chunks/framework.CUflZczI.js";const _=JSON.parse('{"title":"ModalAI VOXL 2","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/modalai_voxl_2.md","filePath":"en/flight_controller/modalai_voxl_2.md"}'),n={name:"en/flight_controller/modalai_voxl_2.md"},l=i('<h1 id="modalai-voxl-2" tabindex="-1">ModalAI VOXL 2 <a class="header-anchor" href="#modalai-voxl-2" aria-label="Permalink to &quot;ModalAI VOXL 2&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://forum.modalai.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The ModalAI <a href="https://modalai.com/voxl-2" target="_blank" rel="noreferrer">VOXL 2</a> (<a href="https://docs.modalai.com/voxl2-datasheets/" target="_blank" rel="noreferrer">Datasheet</a>) is ModalAI’s next-gen autonomous computing platform built around the Qualcomm QRB5165 processor. VOXL 2 boasts 8 cores, integrated PX4, seven camera concurrency, advanced onboard AI up to 15+ TOPS, and 5G connectivity. At 16 grams, VOXL 2 is the future of fully autonomous and connected drones!</p><p><img src="'+t+'" alt="VOXL-2"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="specifications" tabindex="-1">Specifications <a class="header-anchor" href="#specifications" aria-label="Permalink to &quot;Specifications&quot;">​</a></h2><h3 id="system" tabindex="-1">System <a class="header-anchor" href="#system" aria-label="Permalink to &quot;System&quot;">​</a></h3><table><thead><tr><th>Feature</th><th>VOXL 2</th></tr></thead><tbody><tr><td>CPU</td><td>QRB5165 <br>8 cores up to 3.091GHz <br>8GB LPDDR5<br>128GB Flash</td></tr><tr><td>OS</td><td>Ubuntu 18.04 - Linux Kernel v4.19</td></tr><tr><td>GPU</td><td>Adreno 650 GPU – 1024 ALU</td></tr><tr><td>NPU</td><td>15 TOPS</td></tr><tr><td>Flight Controller Embedded</td><td>Yes (Sensors DSP, PX4)</td></tr><tr><td>Built in WiFi</td><td>No</td></tr><tr><td>Add-on Connectivity</td><td>WiFi, 5G, 4G/LTE, Microhard</td></tr><tr><td>Video Encoding</td><td>8K30 h.264/h.265 108MP still images</td></tr><tr><td>Computer Vision Sensors</td><td>QTY 6 4-lane CSI, QTY4 CCI (e.g. 2 stereo pair, hires, tracking)</td></tr><tr><td>Tracking Sensor</td><td>Yes</td></tr><tr><td>Dimensions</td><td>70mm x 36mm</td></tr><tr><td>Weight</td><td>16g</td></tr><tr><td>VOXL SDK: GPS-denied nav., SLAM, obstacle avoidance, object recognition</td><td>Yes</td></tr><tr><td>ROS</td><td>ROS 1 &amp; 2</td></tr><tr><td>QGroundControl</td><td>Yes</td></tr><tr><td>ATAK</td><td>Yes</td></tr><tr><td>NDAA ’20 Section 848 Compliant</td><td>Yes, Assembled in USA</td></tr><tr><td>PMD TOF</td><td>Yes (SDK 1.0 and newer)</td></tr><tr><td>FLIR Boson</td><td>USB</td></tr><tr><td>FLIR Lepton</td><td>USB, SPI</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>More detailed hardware documentation can be found <a href="https://docs.modalai.com/voxl-flight-datasheet/" target="_blank" rel="noreferrer">here</a>.</p></div><h2 id="dimensions" tabindex="-1">Dimensions <a class="header-anchor" href="#dimensions" aria-label="Permalink to &quot;Dimensions&quot;">​</a></h2><h3 id="_2d-dimensions" tabindex="-1">2D Dimensions <a class="header-anchor" href="#_2d-dimensions" aria-label="Permalink to &quot;2D Dimensions&quot;">​</a></h3><p><img src="'+e+'" alt="VOXL2Dimensions"></p><h3 id="_3d-dimensions" tabindex="-1">3D Dimensions <a class="header-anchor" href="#_3d-dimensions" aria-label="Permalink to &quot;3D Dimensions&quot;">​</a></h3><p><a href="https://storage.googleapis.com/modalai_public/modal_drawings/M0054_VOXL2_PVT_SIP_REVA.step" target="_blank" rel="noreferrer">3D STEP File</a></p><h2 id="px4-firmware-compatibility" tabindex="-1">PX4 Firmware Compatibility <a class="header-anchor" href="#px4-firmware-compatibility" aria-label="Permalink to &quot;PX4 Firmware Compatibility&quot;">​</a></h2><h3 id="voxl-dev-branch" tabindex="-1">voxl-dev branch <a class="header-anchor" href="#voxl-dev-branch" aria-label="Permalink to &quot;voxl-dev branch&quot;">​</a></h3><p>ModalAI is actively maintaining a <a href="https://github.com/modalai/px4-firmware/tree/voxl-dev" target="_blank" rel="noreferrer">branched PX4 version</a> that can be used.</p><p>As VOXL 2 runs Ubuntu, the production releases of PX4 for VOXL 2 are distributed through <a href="https://docs.modalai.com/configure-pkg-manager/" target="_blank" rel="noreferrer">apt package management</a> and the <a href="https://docs.modalai.com/voxl-sdk/" target="_blank" rel="noreferrer">VOXL SDK</a>.</p><p>More information about the firmware can be found <a href="https://docs.modalai.com/voxl2-px4-developer-guide/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="main-branch" tabindex="-1">main branch <a class="header-anchor" href="#main-branch" aria-label="Permalink to &quot;main branch&quot;">​</a></h3><p>PX4 mainline supports VOXL 2 (board documentation <a href="https://github.com/PX4/PX4-Autopilot/tree/release/1.15/boards/modalai/voxl2" target="_blank" rel="noreferrer">here</a>).</p><h2 id="qgroundcontrol-support" tabindex="-1">QGroundControl Support <a class="header-anchor" href="#qgroundcontrol-support" aria-label="Permalink to &quot;QGroundControl Support&quot;">​</a></h2><p>This board supported in QGroundControl 4.0 and later.</p><h2 id="availability" tabindex="-1">Availability <a class="header-anchor" href="#availability" aria-label="Permalink to &quot;Availability&quot;">​</a></h2><ul><li><a href="https://www.modalai.com/products/px4-autonomy-developer-kit" target="_blank" rel="noreferrer">PX4 Autonomy Developer Kit</a></li><li><a href="https://www.modalai.com/products/starling-2" target="_blank" rel="noreferrer">Starling 2</a></li><li><a href="https://www.modalai.com/products/starling-2-max" target="_blank" rel="noreferrer">Starling 2 MAX</a></li><li><a href="https://www.modalai.com/pages/sentinel" target="_blank" rel="noreferrer">Sentinel Development Drone powered by VOXL 2</a><ul><li><a href="https://www.youtube.com/watch?v=hMhQgWPLGXo" target="_blank" rel="noreferrer">Demo Video</a></li></ul></li><li><a href="https://www.modalai.com/collections/ready-to-mount/products/voxl-2-flight-deck" target="_blank" rel="noreferrer">VOXL 2 Flight Deck, ready to mount, tune and fly</a></li><li><a href="https://www.modalai.com/products/voxl-2" target="_blank" rel="noreferrer">VOXL 2 Development Kits</a><ul><li><a href="https://www.youtube.com/watch?v=aVHBWbwp488" target="_blank" rel="noreferrer">Demo Video</a></li></ul></li></ul><h2 id="quick-start" tabindex="-1">Quick Start <a class="header-anchor" href="#quick-start" aria-label="Permalink to &quot;Quick Start&quot;">​</a></h2><p>Quickstarts from the vendor are located <a href="https://docs.modalai.com/voxl2-quickstarts/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="voxl-sdk" tabindex="-1">VOXL SDK <a class="header-anchor" href="#voxl-sdk" aria-label="Permalink to &quot;VOXL SDK&quot;">​</a></h3><p>VOXL SDK (Software Development Kit) consists of the open source <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">voxl-px4</a>, <a href="https://docs.modalai.com/core-libs/" target="_blank" rel="noreferrer">core libraries</a>, <a href="https://docs.modalai.com/mpa-services/" target="_blank" rel="noreferrer">services</a>, <a href="https://docs.modalai.com/inspect-tools/" target="_blank" rel="noreferrer">tools</a>, <a href="https://docs.modalai.com/sdk-utilities/" target="_blank" rel="noreferrer">utilities</a>, and <a href="https://docs.modalai.com/build-environments/" target="_blank" rel="noreferrer">build environments</a> that ModalAI provide to accelerate the use and development of VOXL compute boards and accessories.</p><p>VOXL SDK runs on VOXL, VOXL 2 and RB5 Flight!</p><p>The source code for projects within VOXL SDK can be found at <a href="https://gitlab.com/voxl-public" target="_blank" rel="noreferrer">https://gitlab.com/voxl-public</a>, alongside build instructions.</p><h3 id="connectors" tabindex="-1">Connectors <a class="header-anchor" href="#connectors" aria-label="Permalink to &quot;Connectors&quot;">​</a></h3><p>Detailed information about the pinouts can be found <a href="https://docs.modalai.com/voxl2-connectors/" target="_blank" rel="noreferrer">here</a> along with a <a href="https://www.youtube.com/watch?v=xmqI3msjqdo" target="_blank" rel="noreferrer">video overview here</a></p><p><img src="'+r+'" alt="VOXLConnectors"></p><p>All single ended signals on B2B connectors J3, J5, J6, J7, and J8 are 1.8V CMOS unless explicitly noted. All single ended signals on cable-to-board connectors J10, J18, &amp; J19 are 3.3V CMOS unless explicitly noted.</p><table><thead><tr><th>Connector</th><th>Description</th><th>MPN (Board Side)</th><th>Mating MPN (Board/Cable Side)</th><th>Type</th><th>Signal Feature Summary</th></tr></thead><tbody><tr><td>J2</td><td>Fan</td><td>SM02B-SRSS-TB(LF)(SN)</td><td>SHR-02V-S</td><td>Cable Header, 2-pin R/A</td><td>5V DC for FAN + PWM Controlled FAN-Return (GND)</td></tr><tr><td>J3</td><td>Legacy B2B</td><td>QSH-030-01-L-D-K-TR</td><td>QTH-030-01-L-D-A-K-TR</td><td>B2B Receptacle, 60-pin</td><td>5V/3.8V/3.3V/1.8V power for plug-in boards, JTAG and Debug Signals, QUP expansion, GPIOs, USB3.1 Gen 2 (USB1)</td></tr><tr><td>J4</td><td>Prime Power In</td><td>22057045</td><td>0050375043</td><td>Cable Connector, 4-pin R/A</td><td>+5V main DC power in + GND, I2C@5V for power monitors</td></tr><tr><td>J5</td><td>High Speed B2B</td><td>ADF6-30-03.5-L-4-2-A-TR</td><td>ADM6-30-01.5-L-4-2-A-TR</td><td>B2B Socket, 120-pin</td><td>More 3.8V/3.3V/1.8V power for plug-in boards, 5V power in for “SOM Mode”, QUP expansion, GPIOS (including I2S), SDCC (SD Card V3.0), UFS1 (secondary UFS Flash), 2L PCIe Gen 3, AMUX and SPMI PMIC signals</td></tr><tr><td>J6</td><td>Camera Group 0</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B Plug, 60-pin</td><td>Qty-2 4L MIPI CSI ports, CCI and camera control signals, 8 power rails (from 1.05V up to 5V) for cameras and other sensors, dedicated SPI (QUP) port</td></tr><tr><td>J7</td><td>Camera Group 1</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B Plug, 60-pin</td><td>Qty-2 4L MIPI CSI ports, CCI and camera control signals, 8 power rails (from 1.05V up to 5V) for cameras and other sensors, dedicated SPI (QUP) port</td></tr><tr><td>J8</td><td>Camera Group 2</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B Plug, 60-pin</td><td>Qty-2 4L MIPI CSI ports, CCI and camera control signals, 8 power rails (from 1.05V up to 5V) for cameras and other sensors, dedicated SPI (QUP) port</td></tr><tr><td>J9</td><td>USB-C (ADB)</td><td>UJ31-CH-3-SMT-TR</td><td>USB Type-C</td><td>Cable Receptacle, 24-pin R/A</td><td>ADB USB-C with re-driver and display port alternate mode (USB0)</td></tr><tr><td>J10</td><td>SPI Expansion</td><td>SM08B-GHS-TB(LF)(SN)</td><td>GHR-08V-S</td><td>Cable Header, 8-pin R/A</td><td>SPI@3.3V with 2 CS_N pins, 32kHz CLK_OUT@3.3V</td></tr><tr><td>J18</td><td>ESC (SLPI Access)</td><td>SM04B-GHS-TB(LF)(SN)</td><td>GHR-04V-S</td><td>Cable Header, 4-pin R/A</td><td>ESC UART@3.3V, 3.3V reference voltage</td></tr><tr><td>J19</td><td>GNSS/MAG/RC/I2C (SLPI Access)</td><td>SM12B-GHS-TB(LF)(SN)</td><td>GHR-12V-S</td><td>Cable Header, 6-pin R/A</td><td>GNSS UART@3.3V, Magnetometer I2C@3.3V, 5V, RC UART, Spare I2C</td></tr></tbody></table><h3 id="user-guide" tabindex="-1">User Guide <a class="header-anchor" href="#user-guide" aria-label="Permalink to &quot;User Guide&quot;">​</a></h3><p>The PX4 user guide for VOXL 2 is available <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="developer-guide" tabindex="-1">Developer Guide <a class="header-anchor" href="#developer-guide" aria-label="Permalink to &quot;Developer Guide&quot;">​</a></h3><p>The PX4 developer guide for VOXL 2 is available <a href="https://docs.modalai.com/voxl-px4-developer-guide/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="how-to-build" tabindex="-1">How to Build <a class="header-anchor" href="#how-to-build" aria-label="Permalink to &quot;How to Build&quot;">​</a></h3><p>See the <a href="https://docs.modalai.com/voxl2-px4-build-guide/" target="_blank" rel="noreferrer">VOXL PX4 Build Guide</a> on how to build.</p><h2 id="support" tabindex="-1">Support <a class="header-anchor" href="#support" aria-label="Permalink to &quot;Support&quot;">​</a></h2><p>Please visit the <a href="https://forum.modalai.com/category/26/voxl-2" target="_blank" rel="noreferrer">ModalAI Forum</a> for more information.</p>',44),s=[l];function c(h,p,m,u,b,f){return d(),o("div",null,s)}const v=a(n,[["render",c]]);export{_ as __pageData,v as default};
